INSERT INTO `mos_page` VALUES ('1', '0', '公司介绍', '', '公司介绍', '<h2 style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';background-color:#FFFFFF;\">\r\n	公司介绍\r\n</h2>\r\n<span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">上海顶想信息科技有限公司（TOPThink Inc.）是国内领先的WEB应用和服务提供商致力于WEB应用平台、产品和应用的研发和服务，为企事业单位提供基于WEB的应用开发快速解决方案和产品。公司成立于2008年9月，是一家拥有自主知识产权的高新企业。</span><br />\r\n<span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">公司长期专注于WEB应用框架、应用平台和企业解决方案的研究，公司的核心技术框架ThinkPHP由创始人刘晨于2006年创立，经过7年多的精心打造和发展，具有广泛的用户基础和良好的业内口碑，已经成长为国内领先和最具影响力的WEB应用开发框架，国外同比也具有相当大的优势。其应用领域分布于各个行业，在门户、社区和电子商务领域有着非常良好支持以及拓展，大小案例不下千家，在安全、效率、负载上都有很大优势，已经成为WEB应用的快速开发解决方案和最佳实践！</span><br />\r\n<br />\r\n<span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">公司总部位于上海，由从事互联网和用户体验研究达10年的资深专家领军，拥有一批专业的策划、设计和技术团队以及广泛的社区技术力量。公司长期以来凭借业内的影响力、良好的客户和合作关系，邀请了众多安全和项目专家作为顾问，有力得保证了客户项目的开发和实施。公司还拥有一支资深用户体验和设计研究队伍，针对不同用户量身定做用户体验流程，有着良好的产品设计和设计概念。</span><br />\r\n<br />\r\n<br />\r\n<h2 style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';background-color:#FFFFFF;\">\r\n	公司理念\r\n</h2>\r\n<span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">公司理念：专业源于专注，细节决定成败。</span><br />\r\n<span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">我们的口号是：WE CAN DO IT ,JUST THINK !</span><br />\r\n<br />\r\n<br />\r\n<h2 style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';background-color:#FFFFFF;\">\r\n	公司服务\r\n</h2>\r\n<span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">专业网站策划开发</span><br />\r\n<span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">企业业务系统定制</span><br />\r\n<span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">为企业应用提供一系列的解决方案</span><br />\r\n<span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">ThinkPHP认证培训</span><br />\r\n<br />\r\n<br />\r\n<h2 style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';background-color:#FFFFFF;\">\r\n	公司优势\r\n</h2>\r\n<span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">ThinkPHP 6年的用户基础和口碑</span><br />\r\n<span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">日益增加的典型案例</span><br />\r\n<span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">具有技术优势的团队</span><br />\r\n<span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">广泛的合作资源，包括：校园、企业、培训和媒体</span><br />\r\n<br />\r\n<br />\r\n<h2 style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';background-color:#FFFFFF;\">\r\n	公司价值观\r\n</h2>\r\n<b>合作</b><span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">&nbsp;—— 团队合作，共同成长</span><br />\r\n<b>专业</b><span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">&nbsp;—— 提倡专业素质</span><br />\r\n<b>专注</b><span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">&nbsp;—— 成为某个领域的专家</span><br />\r\n<b>创新</b><span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">&nbsp;—— 持续创新，不断改进</span><br />\r\n<b>服务</b><span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">&nbsp;—— 给客户最满意的服务而不是产品</span><br />\r\n<b>贡献</b><span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">&nbsp;—— 有贡献就有收获</span><br />\r\n<br />\r\n<br />\r\n<h2 style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';background-color:#FFFFFF;\">\r\n	我们的客户\r\n</h2>\r\n<span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">国家保密局 中青旅 联想中国 美特斯邦威 腾讯家居 凤凰家居 56.Com 星巴克 宝矿力水特 特力屋 奔驰 莆田在线 都市客 商虎网 泡面三国 三国英雄传 贵州便民网 中国西部开发网 中华家园网 记忆日 互动日程 魔力岛 巨人网络 灵通集团…</span><br />\r\n<span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">更多典型案例演示：</span><a href=\"http://www.thinkphp.cn/Case/\" target=\"_blank\">http://www.thinkphp.cn/Case/&nbsp;</a><br />\r\n<br />\r\n<span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">社 区：</span><a href=\"http://thinkphp.cn/\" target=\"_blank\">http://thinkphp.cn/</a><br />\r\n<span style=\"color:#323232;font-family:\'Century Gothic\', \'Microsoft yahei\';font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">公司官网：</span><a href=\"http://topthink.net/\" target=\"_blank\">http://topthink.net/</a>', '255', '1464939566', '1464939566');
INSERT INTO `mos_page` VALUES ('2', '1', '关于我们', '关于我们 ', '关于我们', '<h2 style=\"color:#323232;font-family:&#39;Century Gothic&#39;, &#39;Microsoft yahei&#39;;background-color:#FFFFFF;\">&nbsp; &nbsp;\r\n	公司介绍</h2><p><span style=\"color:#323232;font-family:&#39;Century Gothic&#39;, &#39;Microsoft yahei&#39;;font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">上海顶想信息科技有限公司（TOPThink Inc.）是国内领先的WEB应用和服务提供商致力于WEB应用平台、产品和应用的研发和服务，为企事业单位提供基于WEB的应用开发快速解决方案和产品。公司成立于2008年9月，是一家拥有自主知识产权的高新企业。</span><br/><span style=\"color:#323232;font-family:&#39;Century Gothic&#39;, &#39;Microsoft yahei&#39;;font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">公司长期专注于WEB应用框架、应用平台和企业解决方案的研究，公司的核心技术框架ThinkPHP由创始人刘晨于2006年创立，经过7年多的精心打造和发展，具有广泛的用户基础和良好的业内口碑，已经成长为国内领先和最具影响力的WEB应用开发框架，国外同比也具有相当大的优势。其应用领域分布于各个行业，在门户、社区和电子商务领域有着非常良好支持以及拓展，大小案例不下千家，在安全、效率、负载上都有很大优势，已经成为WEB应用的快速开发解决方案和最佳实践！</span><br/><br/><span style=\"color:#323232;font-family:&#39;Century Gothic&#39;, &#39;Microsoft yahei&#39;;font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">公司总部位于上海，由从事互联网和用户体验研究达10年的资深专家领军，拥有一批专业的策划、设计和技术团队以及广泛的社区技术力量。公司长期以来凭借业内的影响力、良好的客户和合作关系，邀请了众多安全和项目专家作为顾问，有力得保证了客户项目的开发和实施。公司还拥有一支资深用户体验和设计研究队伍，针对不同用户量身定做用户体验流程，有着良好的产品设计和设计概念。</span><br/><br/><br/></p><h2 style=\"color:#323232;font-family:&#39;Century Gothic&#39;, &#39;Microsoft yahei&#39;;background-color:#FFFFFF;\">&nbsp; &nbsp;\r\n	公司理念</h2><p><span style=\"color:#323232;font-family:&#39;Century Gothic&#39;, &#39;Microsoft yahei&#39;;font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">公司理念：专业源于专注，细节决定成败。</span><br/><span style=\"color:#323232;font-family:&#39;Century Gothic&#39;, &#39;Microsoft yahei&#39;;font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">我们的口号是：WE CAN DO IT ,JUST THINK !</span><br/><br/><br/></p><h2 style=\"color:#323232;font-family:&#39;Century Gothic&#39;, &#39;Microsoft yahei&#39;;background-color:#FFFFFF;\">&nbsp; &nbsp;\r\n	公司服务</h2><p><span style=\"color:#323232;font-family:&#39;Century Gothic&#39;, &#39;Microsoft yahei&#39;;font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">专业网站策划开发</span><br/><span style=\"color:#323232;font-family:&#39;Century Gothic&#39;, &#39;Microsoft yahei&#39;;font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">企业业务系统定制</span><br/><span style=\"color:#323232;font-family:&#39;Century Gothic&#39;, &#39;Microsoft yahei&#39;;font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">为企业应用提供一系列的解决方案</span><br/><span style=\"color:#323232;font-family:&#39;Century Gothic&#39;, &#39;Microsoft yahei&#39;;font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">ThinkPHP认证培训</span><br/><br/><br/></p><h2 style=\"color:#323232;font-family:&#39;Century Gothic&#39;, &#39;Microsoft yahei&#39;;background-color:#FFFFFF;\">&nbsp; &nbsp;\r\n	公司优势</h2><p><span style=\"color:#323232;font-family:&#39;Century Gothic&#39;, &#39;Microsoft yahei&#39;;font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">ThinkPHP 6年的用户基础和口碑</span><br/><span style=\"color:#323232;font-family:&#39;Century Gothic&#39;, &#39;Microsoft yahei&#39;;font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">日益增加的典型案例</span><br/><span style=\"color:#323232;font-family:&#39;Century Gothic&#39;, &#39;Microsoft yahei&#39;;font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">具有技术优势的团队</span><br/><span style=\"color:#323232;font-family:&#39;Century Gothic&#39;, &#39;Microsoft yahei&#39;;font-size:16px;line-height:35.2px;background-color:#FFFFFF;\">广泛的合作资源，包括：校园、企业、培训和媒体</span><br/><br/><br/></p><h2 style=\"color:#323232;font-family:&#39;Century Gothic&#39;, &#39;Microsoft yahei&#39;;background-color:#FFFFFF;\">&nbsp; &nbsp;\r\n	公司价值观</h2><p><strong>合作</strong><span style=\"color:#323232;font-family:&#39;Century Gothic&#39;, &#39;Microsoft yahei&#39;;font-size:16px;line-height:35.2px;background-color:#FFFFFF;\"> —— 团队合作，共同成长</span><br/><strong>专业</strong><span style=\"color:#323232;font-family:&#39;Century Gothic&#39;, &#39;Microso