-- ----------------------------
-- Table structure for mos_card_info
-- ----------------------------
DROP TABLE IF EXISTS `mos_card_info`;
CREATE TABLE `mos_card_info` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增主键',
  `cardSN` varchar(30) DEFAULT NULL COMMENT '卡券编号 区分同名卡券',
  `name` varchar(30) DEFAULT NULL COMMENT '卡券名(建议涵盖卡券属性、服务及金额) 通用属性',
  `notice` varchar(50) DEFAULT NULL COMMENT '卡券使用提醒 通用属性',
  `custom` text COMMENT '自定义字段json保存 通用属性',
  `useType` tinyint(4) NOT NULL COMMENT '卡券使用类型 1:平台可用 2:指定商户',
  `contactNumber` varchar(255) DEFAULT NULL COMMENT '可用餐厅编号 指定商户类型属性',
  `contactName` varchar(100) DEFAULT NULL COMMENT '可用餐厅名称 指定商户属性',
  `cardCount` int(11) unsigned DEFAULT NULL COMMENT '卡券总数',
  `cardNumber` int(11) unsigned DEFAULT NULL COMMENT '卡券剩余数量',
  `cardType` tinyint(4) NOT NULL COMMENT '卡券类型 1:折扣券 2:满减券 3:指定商品优惠券',
  `minDiscountPaid` decimal(11,2) DEFAULT NULL COMMENT '最低消费金额 达到最低消费要求才可使用 满减券指定商品优惠券必填 折扣卷选填',
  `discountRate` smallint(6) DEFAULT NULL COMMENT '折扣率数值 正整数 折扣券7折为30 75折为25 数值小于100 折扣券属性',
  `maxDiscountRateMoney` decimal(11,2) DEFAULT NULL COMMENT '折扣券最高减免金额 如封顶20元 折扣券属性(非必填)',
  `discountMoney` decimal(11,2) DEFAULT NULL COMMENT '减免金额 满减金额需小于最低消费金额 满减券或指定商品优惠券属性',
  `goodsId` int(11) DEFAULT NULL COMMENT '可用商品ID 指定商品优惠券属性',
  `goodsNumber` varchar(50) DEFAULT NULL COMMENT '可用商品编号 指定商品优惠券属性',
  `goodsName` varchar(50) DEFAULT NULL COMMENT '可用商品名称 指定商品优惠券属性',
  `receiptStartTime` int(11) DEFAULT NULL COMMENT '卡券领取开始时间',
  `receiptEndTime` int(11) DEFAULT NULL COMMENT '卡券领取结束时间',
  `distributeType` tinyint(4) DEFAULT NULL COMMENT '卡券派发方式 1:二维码扫码派发 2:消费满派发 3:商家/平台批量派发 4:登录自动派发',
  `distributeUrl` varchar(255) DEFAULT NULL COMMENT '派发地址 二维码扫码派发属性',
  `distributeMoney` decimal(11,2) DEFAULT NULL COMMENT '消费满多少派发(实际支付金额)',
  `timeType` tinyint(4) NOT NULL COMMENT '卡券可用时间类型 1:领取后一段时间内(如领取后7天可用) 2:指定开始结束日期 3:永久有效',
  `timeLength` varchar(30) DEFAULT NULL COMMENT '领取后有效时长 按照 年-月-日-时-分-秒 保存 没有的用0 如领取后7天有效:0-0-7-0-0-0 timeType=1属性',
  `validStartTime` int(11) DEFAULT NULL COMMENT '可用开始时间 timeType=2属性',
  `validEndTime` int(11) DEFAULT NULL COMMENT '可用结束时间',
  `limitNumber` smallint(6) DEFAULT NULL COMMENT '用户领取次数限制 一般为1',
  `status` tinyint(4) DEFAULT NULL COMMENT '状态 1:启用 0:禁用',
  `isDelete` tinyint(4) DEFAULT NULL COMMENT '是否删除 0:未删除 1:已删除',
  `ctime` int(11) DEFAULT NULL COMMENT '创建时间',
  `utime` int(11) DEFAULT NULL COMMENT '修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=22 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of mos_card_info
-- ----------------------------

-- ----------------------------
-- Table structure for mos_card_record
-- ----------------------------
DROP TABLE IF EXISTS `mos_card_record`;
CREATE TABLE `mos_card_record` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增主键',
  `cardId` int(11) DEFAULT NULL COMMENT '卡券id',
  `cardCode` varchar(64) DEFAULT NULL COMMENT '卡券code码',
  `cName` varchar(30) DEFAULT NULL COMMENT '卡券名',
  `cNotice` varchar(50) DEFAULT NULL COMMENT '卡券使用提醒',
  `cCustom` varchar(255) DEFAULT NULL COMMENT '自定义字段json保存',
  `cUseType` tinyint(4) DEFAULT NULL COMMENT '卡券使用类型 1:平台可用 2:指定商户',
  `cContactNumber` varchar(255) DEFAULT NULL COMMENT '可用餐厅编号 指定商户属性',
  `cContactName` varchar(40) DEFAULT NULL COMMENT '可用餐厅名称 指定商户属性',
  `cCardType` tinyint(4) DEFAULT NULL COMMENT '卡券类型 1:折扣券 2:满减券 3:指定商品优惠券',
  `cMinDiscountPaid` decimal(11,2) DEFAULT NULL COMMENT '最低消费金额 达到最低消费要求才可使用 满减券指定商品优惠券必填 折扣卷选填 ',
  `cDiscountRate` smallint(6) DEFAULT NULL COMMENT '折扣率数值为正整数 折扣券7折为30 75折为25 数值小于100 折扣券属性',
  `cMaxDiscountRateMoney` decimal(11,2) DEFAULT NULL COMMENT '折扣券最高减免金额 如封顶20元 折扣券属性(非必填)',
  `cDiscountMoney` decimal(11,2) DEFAULT NULL COMMENT '减免金额 满减金额需小于最低消费金额 满减券或指定商品优惠券属性 --新增要求(满减金额需小于最低消费金额',
  `cGoodsNumber` varchar(50) DEFAULT NULL COMMENT '可用商品编号 指定商品优惠券属性',
  `cGoodsName` varchar(50) DEFAULT NULL COMMENT '可用商品名称 指定商品优惠券属性',
  `openid` varchar(100) DEFAULT NULL COMMENT '用户openid',
  `useTimeType` tinyint(4) DEFAULT NULL COMMENT '1:有使用日期限制 2:永久有效',
  `useStartTime` int(11) DEFAULT NULL COMMENT '可用开始时间',
  `useEndTime` int(11) DEFAULT NULL COMMENT '可用结束时间',
  `status` tinyint(4) DEFAULT NULL COMMENT '状态 0:不可用 1:可用 2:已使用',
  `orderSN` varchar(50) DEFAULT NULL COMMENT '使用订单编号',
  `ctime` int(11) DEFAULT NULL COMMENT '领取时间',
  `utime` int(11) DEFAULT NULL COMMENT '状态修改时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=83 DEFAULT CHARSET=utf8;

