-- Table structure for mos_contact_balance
-- ----------------------------
DROP TABLE IF EXISTS `mos_contact_balance`;
CREATE TABLE `mos_contact_balance` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增主键',
  `contactNumber` varchar(64) DEFAULT NULL COMMENT '商家编号',
  `balanceNumber` varchar(128) DEFAULT NULL COMMENT '业务单号(收入为订单号,支出为提款单号)',
  `balanceType` tinyint(4) DEFAULT NULL COMMENT '订单类型 1交易 2提现 3手续费',
  `balanceChange` tinyint(4) DEFAULT NULL COMMENT '流水变化 1收入 2支出',
  `balanceBegin` decimal(11,2) DEFAULT NULL COMMENT '流水结余前金额',
  `balanceMoney` decimal(11,2) DEFAULT NULL COMMENT '流水金额',
  `balanceEnd` decimal(11,2) DEFAULT NULL COMMENT '流水结余金额',
  `payMethodId` int(11) DEFAULT NULL COMMENT '支付通道ID',
  `payMethodName` varchar(255) DEFAULT NULL COMMENT '支付通道名称',
  `payTime` datetime DEFAULT NULL COMMENT '(付款/提现)日期时间',
  `merCalcAccountDate` varchar(64) DEFAULT NULL COMMENT '商户理论结算日（根据商户计算所得）',
  `merAccountDate` varchar(64) DEFAULT NULL COMMENT '商户实际结算日（根据实际结算日期反写）',
  `isMerSettlements` tinyint(4) NOT NULL DEFAULT '0' COMMENT '商户是否结算(0:未结算,1:已结算)',
  `payCalcAccountDate` varchar(64) DEFAULT NULL COMMENT '支付公司j理论结算日（根据支付通道计算所得）',
  `payAccountDate` varchar(64) DEFAULT NULL COMMENT '支付公司实际结算日（根据实际结算日期反写）',
  `isPaySettlements` tinyint(4) NOT NULL DEFAULT '0' COMMENT '支付渠道是否结算(0:未结算,1:已结算)',
  `ctime` datetime DEFAULT NULL COMMENT '记录创建时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=907 DEFAULT CHARSET=utf8 COMMENT='账目流水表';

