-- ----------------------------
-- Table structure for mos_food_court
-- ----------------------------
DROP TABLE IF EXISTS `mos_food_court`;
CREATE TABLE `mos_food_court` (
  `id` smallint(11) NOT NULL AUTO_INCREMENT,
  `logoUrl` varchar(255) NOT NULL COMMENT '美食广场的logo',
  `bgImageUrl` varchar(255) NOT NULL COMMENT '美食广场的背景图',
  `market` int(11) DEFAULT NULL COMMENT '推广员id',
  `name` varchar(100) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT '' COMMENT '美食广场名称',
  `number` varchar(64) DEFAULT '' COMMENT '美食广场编号',
  `cCategory` smallint(40) DEFAULT '0' COMMENT '客户类别',
  `cCategoryName` varchar(100) DEFAULT '' COMMENT '分类名称',
  `member` int(11) DEFAULT NULL COMMENT '餐桌数量',
  `reason` varchar(255) DEFAULT NULL COMMENT '申请拒绝理由',
  `codeStatus` tinyint(4) DEFAULT '0' COMMENT '二维码状态(0未制作，1制作中，2制作完成，3已派发)',
  `linkMans` text COMMENT '客户联系方式',
  `contactType` smallint(5) DEFAULT NULL COMMENT '餐厅类型1:微信&支付宝 2:微信 3:支付宝',
  `bank_id` int(11) DEFAULT NULL COMMENT '银行id',
  `account_number` varchar(64) DEFAULT NULL COMMENT '银行账号',
  `account_name` varchar(64) DEFAULT NULL COMMENT '开户人姓名',
  `rate` decimal(11,2) DEFAULT '0.60' COMMENT '费率(订单抽点的百分比值)',
  `cycle` int(11) unsigned DEFAULT NULL COMMENT '结算周期',
  `bank_name` varchar(100) DEFAULT NULL COMMENT '开户银行',
  `disable` tinyint(1) DEFAULT '0' COMMENT '0：新申请 1：已安装',
  `qrtime` int(11) unsigned DEFAULT NULL COMMENT '二维码修改时间',
  `retime` int(11) unsigned DEFAULT NULL COMMENT '审核时间',
  `ctime` int(11) unsigned DEFAULT NULL COMMENT '提交申请时间',
  `remark` text COMMENT '备注',
  `address` varchar(255) DEFAULT NULL COMMENT '餐厅地址',
  `longitude` varchar(64) DEFAULT NULL COMMENT '餐厅经度',
  `latitude` varchar(64) DEFAULT NULL COMMENT '餐厅纬度',
  `qrcode` varchar(255) DEFAULT NULL COMMENT '美食广场二维码储存',
  `secretKey` varchar(50) DEFAULT 'a0b1c2d3e4f5g6h7i8j9klmnopqrstuv' COMMENT 'key值 用来获取token 32位',
  `token` varchar(50) DEFAULT NULL COMMENT 'token 32位',
  `tokenCreateTime` int(11) DEFAULT NULL COMMENT 'token创建时间',
  `tokenExpiredTime` int(11) DEFAULT NULL COMMENT 'token有效时间',
  `isDelete` tinyint(1) DEFAULT '0' COMMENT '0正常 1删除',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=13 DEFAULT CHARSET=utf8;

