DROP TABLE IF EXISTS `mos_goods`;
CREATE TABLE `mos_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) DEFAULT '' COMMENT '商品名称',
  `name_en` varchar(255) DEFAULT '' COMMENT '商品名称',
  `name_other` varchar(255) DEFAULT '' COMMENT '商品名称',
  `number` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '商品编号',
  `categoryId` smallint(6) DEFAULT '0' COMMENT '商品分类ID',
  `categoryName` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT '' COMMENT '分类名称',
  `contactNumber` varchar(255) DEFAULT NULL COMMENT '商家编号',
  `payType` tinyint(2) NOT NULL DEFAULT '1' COMMENT '计价方式 1:按份计价 2:单位重量收费',
  `payUnit` varchar(5) DEFAULT NULL COMMENT '收费单位',
  `salePrice` decimal(10,2) DEFAULT '0.00' COMMENT '销售单价',
  `remark` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT '' COMMENT '备注',
  `remark_en` varchar(255) DEFAULT '' COMMENT '备注',
  `remark_other` varchar(255) DEFAULT '' COMMENT '备注',
