  `sort` smallint(6) DEFAULT NULL COMMENT '排序',
  `disable` tinyint(1) DEFAULT '0' COMMENT '1启用   0禁用',
  `isDelete` tinyint(1) DEFAULT '0' COMMENT '0正常  1删除',
  PRIMARY KEY (`number`),
  KEY `number` (`number`),
  KEY `id` (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=884 DEFAULT CHARSET=utf8;

