  `orderMoney` decimal(11,2) DEFAULT NULL COMMENT '订单总额',
  `percent` decimal(11,2) DEFAULT NULL COMMENT '佣金比例的百分比 例:1% 记录为 1',
  `commission` decimal(11,2) DEFAULT NULL COMMENT '佣金',
  `balanceDate` varchar(64) DEFAULT NULL COMMENT '结算日期',
  `isStatement` tinyint(4) DEFAULT '0' COMMENT '是否结算(月、季度、年结算)',
  `ctime` datetime DEFAULT NULL COMMENT '生成时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=167 DEFAULT CHARSET=utf8 COMMENT='日结算佣金报表';

-- ----------------------------
-- Records of mos_sales_statements_day
-- ----------------------------

-- ----------------------------
-- Table structure for mos_sales_statements_total
-- ----------------------------
DROP TABLE IF EXISTS `mos_sales_statements_total`;
CREATE TABLE `mos_sales_statements_total` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `bizNo` varchar(64) DEFAULT NULL COMMENT '业务编号',
  `bizType` varchar(40) DEFAULT NULL COMMENT '业务类型(机构:mechanism,业务员:salesman)',
  `bizId` int(11) DEFAULT NULL COMMENT '业务ID(根据业务类型,分机构ID和业务员ID)',
  `bizName` varchar(100) DEFAULT NULL COMMENT '业务名称(根据业务类型,分机构名称和业务员名称)',
  `salesId` int(11) DEFAULT NULL COMMENT '业务员ID及机构管理员ID',
  `salesName` varchar(100) DEFAULT NULL COMMENT '业务员名称及机构管理员名称)',
  `payable_bn_id` int(11) DEFAULT NULL COMMENT '发款银行账号id',
  `statementsCycle` varchar(40) DEFAULT NULL COMMENT '结算周期',
  `payTimeStart` datetime DEFAULT NULL COMMENT '交易起始日期时间',
  `payTimeEnd` datetime DEFAULT NULL COMMENT '交易结束日期时间',
  `orderMoney` decimal(11,2) DEFAULT NULL COMMENT '订单总额',
  `percent` decimal(11,2) DEFAULT NULL COMMENT '佣金比例的百分比 例:1% 记录为 1',
  `commission` decimal(11,2) DEFAULT NULL COMMENT '佣金',
  `balanceDate` varchar(40) DEFAULT NULL COMMENT '结算日期',
  `ctime` datetime DEFAULT NULL COMMENT '记录创建时间',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=87 DEFAULT CHARSET=utf8 COMMENT='月结算佣金报表';

