-- ----------------------------
-- Table structure for mos_set_meal
-- ----------------------------
DROP TABLE IF EXISTS `mos_set_meal`;
CREATE TABLE `mos_set_meal` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增主键',
  `name` varchar(50) DEFAULT NULL COMMENT '套餐名',
  `name_en` varchar(255) DEFAULT '' COMMENT '套餐名称',
  `name_other` varchar(255) DEFAULT '' COMMENT '套餐名称',
  `totlePrice` decimal(10,2) DEFAULT NULL COMMENT '套装总价',
  `contactNumber` varchar(60) DEFAULT NULL COMMENT '餐厅编号',
  `categoryId` int(11) DEFAULT NULL COMMENT '餐厅菜品分类的值(非套餐分类)',
  `categoryName` varchar(50) DEFAULT NULL COMMENT '分类名称',
  `imgUrl` text COMMENT '套餐图片',
  `thumbnailUrl` text COMMENT '图片路径（套餐缩略图url）',
  `remark` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci DEFAULT '' COMMENT '备注',
  `remark_en` varchar(255) DEFAULT '' COMMENT '备注',
  `remark_other` varchar(255) DEFAULT '' COMMENT '备注',
  `detail` text COMMENT '详情',
  `detail_en` text COMMENT '详情',
  `detail_other` text COMMENT '详情',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '状态 0:禁用 1启用 默认1',
  `ctime` int(11) DEFAULT NULL COMMENT '创建时间',
  `utime` int(11) DEFAULT NULL COMMENT '修改时间',
  `isDelete` tinyint(2) NOT NULL DEFAULT '0' COMMENT '是否删除 0:未删除 1:已删除 默认0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=38 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of mos_set_meal
-- ----------------------------

-- ----------------------------
-- Table structure for mos_set_meal_category
-- ----------------------------
DROP TABLE IF EXISTS `mos_set_meal_category`;
CREATE TABLE `mos_set_meal_category` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增主键',
  `mid` int(11) unsigned DEFAULT NULL COMMENT '套餐id',
  `name` varchar(50) DEFAULT NULL COMMENT '套餐分类名',
  `name_en` varchar(255) DEFAULT '' COMMENT '套餐分类英文',
  `name_other` varchar(255) DEFAULT '' COMMENT '套餐分类其他语言',
  `categoryMaxNumber` smallint(6) DEFAULT NULL COMMENT '分类最大选择数量',
  `goodsMaxNumber` smallint(6) DEFAULT NULL COMMENT '单项最大选择数量',
  `sort` smallint(6) DEFAULT '0' COMMENT '菜品排序',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '状态 0:禁用 1启用',
  `ctime` int(11) DEFAULT NULL COMMENT '创建时间',
  `utime` int(11) DEFAULT NULL COMMENT '修改时间',
  `isDelete` tinyint(2) NOT NULL DEFAULT '0' COMMENT '是否删除 0:未删除 1:已删除 默认0',
  PRIMARY KEY (`id`),
  KEY `sort` (`sort`)
) ENGINE=MyISAM AUTO_INCREMENT=65 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of mos_set_meal_category
-- ----------------------------

-- ----------------------------
-- Table structure for mos_set_meal_info
-- ----------------------------
DROP TABLE IF EXISTS `mos_set_meal_info`;
CREATE TABLE `mos_set_meal_info` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT COMMENT '自增主键',
  `mid` int(11) unsigned DEFAULT NULL COMMENT '套餐id',
  `cid` int(11) unsigned DEFAULT NULL COMMENT '套餐分类id',
  `gid` int(11) DEFAULT NULL COMMENT '菜品id',
  `sort` smallint(6) DEFAULT '0' COMMENT '菜品排序',
  `status` tinyint(2) NOT NULL DEFAULT '1' COMMENT '状态 0:禁用 1启用',
  `ctime` int(11) DEFAULT NULL COMMENT '创建时间',
  `utime` int(11) DEFAULT NULL COMMENT '修改时间',
  `isDelete` tinyint(2) NOT NULL DEFAULT '0' COMMENT '是否删除 0:未删除 1:已删除 默认0',
  PRIMARY KEY (`id`),
  KEY `sort` (`sort`) USING BTREE
) ENGINE=MyISAM AUTO_INCREMENT=422 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of mos_set_meal_info
-- ----------------------------

-- ----------------------------
-- Table structure for mos_spec
-- ----------------------------
DROP TABLE IF EXISTS `mos_spec`;
CREATE TABLE `mos_spec` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '自增主键',
  `spec_pid` int(11) NOT NULL DEFAULT '0' COMMENT '父级id 顶级规格pid为0',
  `spec_name` varchar(64) DEFAULT NULL COMMENT '规格名称',
  `spec_name_en` varchar(255) DEFAULT NULL COMMENT '规格名称英文',
  `spec_name_other` varchar(255) DEFAULT NULL COMMENT '规格名称其他语言',
  `spec_disable` tinyint(4) NOT NULL DEFAULT '1' COMMENT '规格状态 0禁用(前端不显示) 1启用 2不可选(前端显示灰色不可选)',
  `spec_order` smallint(6) NOT NULL DEFAULT '1' COMMENT '规格排序 小的排前面',
  `spec_price` decimal(10,2) NOT NULL DEFAULT '0.00',
  `contactNumber` varchar(50) DEFAULT NULL COMMENT '规格所属餐厅编号',
  `minselect` smallint(6) DEFAULT '1' COMMENT '规格子类最小可选数',
  `maxselect` smallint(6) DEFAULT '1' COMMENT '规格子类最大可选数',
  `isDelete` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否删除 0未删除 1已删除',
  `is_repeat` tinyint(1) NOT NULL DEFAULT '0',
  `is_default` tinyint(1) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=270 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of mos_spec
-- ----------------------------

-- ----------------------------
-- Table structure for mos_system_log
-- ----------------------------
DROP TABLE IF EXISTS `mos_system_log`;
CREATE TABLE `mos_system_log` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '登录用户id',
  `remark` varchar(255) DEFAULT '' COMMENT '简单说明',
  `ip` varchar(20) DEFAULT NULL COMMENT 'IP地址',
  `op_time` int(11) DEFAULT NULL COMMENT '时间',
  PRIMARY KEY (`id`),
  KEY `userId` (`user_id`)
) ENGINE=MyISAM AUTO_INCREMENT=916 DEFAULT CHARSET=utf8 COMMENT='后台操作日志表';

-- ----------------------------
-- Records of mos_system_log
-- ----------------------------

-- ----------------------------
-- Table structure for mos_user
-- ----------------------------
DROP TABLE IF EXISTS `mos_user`;
CREATE TABLE `mos_user` (
  `zid` int(11) NOT NULL AUTO_INCREMENT,
  `uid` int(11) NOT NULL,
  `name` varchar(32) NOT NULL COMMENT '用户姓名',
  `nick` varchar(32) DEFAULT NULL COMMENT '昵称',
  `password` varchar(64) NOT NULL COMMENT '用户密码',
  `mobile` varchar(32) DEFAULT NULL,
  `email` varchar(128) DEFAULT NULL COMMENT '邮箱',
  `status` tinyint(5) NOT NULL COMMENT '是否启用',
  `head` varchar(150) DEFAULT NULL,
  `qrcode` varchar(150) DEFAULT NULL COMMENT '市场人员二维码',
  `super` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否超级管理员 0否 1是',
  `is_contact` tinyint(4) NOT NULL DEFAULT '0' COMMENT '账号类型 0:后台管理员 1:商家 2:员工 3:推广员 4:美食广',
  `contact_number` varchar(255) DEFAULT NULL COMMENT '商家编号：商户及商户员工，系统管理员没有有这个编号',
  `mechanismId` int(11) NOT NULL DEFAULT '0' COMMENT '机构id,非机构人员为空',
  `mechanismAdmin` tinyint(4) NOT NULL DEFAULT '0' COMMENT '机构主账号,非主账号为空 主账号为1',
  `commissionId` int(11) NOT NULL DEFAULT '0' COMMENT '佣金分组id,非市场人员为空',
  `commission` decimal(11,2) DEFAULT NULL,
  `payable_bn_id` int(11) DEFAULT NULL COMMENT '发款账号id',
  `bank_id` int(11) DEFAULT NULL COMMENT '银行id',
  `bank_name` varchar(255) DEFAULT NULL COMMENT '开户银行',
  `account_number` varchar(64) DEFAULT NULL COMMENT '银行账号',
  `account_name` varchar(32) DEFAULT NULL COMMENT '开户人姓名',
  `create_time` int(11) NOT NULL COMMENT '创建时间',
  `update_time` int(11) NOT NULL COMMENT '更新时间',
  PRIMARY KEY (`zid`)
) ENGINE=MyISAM AUTO_INCREMENT=102 DEFAULT CHARSET=utf8 COMMENT='后台用户表';

-- ----------------------------
-- Records of mos_user
-- ----------------------------

-- ----------------------------
-- Table structure for mos_wx_order
-- ----------------------------
DROP TABLE IF EXISTS `mos_wx_order`;
CREATE TABLE `mos_wx_order` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `orderSN` varchar(50) NOT NULL COMMENT '订单编号',
  `userId` varchar(100) NOT NULL COMMENT '购买者ID（微信ID）',
  `userNick` varchar(128) DEFAULT NULL,
  `userType` smallint(5) NOT NULL,
  `orderStatus` int(11) NOT NULL DEFAULT '0' COMMENT '订单状态0:已取消  1:未付款 2:已付款 3:已接单 4:已确认 5:已完成',
  `payStatus` int(11) NOT NULL DEFAULT '0' COMMENT '是否付款0:未付款  1:已付款 2:已退款',
  `payType` smallint(5) DEFAULT NULL COMMENT '''1''     =>  ''微信支付'',         ''2''     =>  ''支付寶支付'',         ''3''     =>  ''網銀支付'',         ''4''     =>  ''快捷支付'',',
  `payName` varchar(50) DEFAULT '微信支付' COMMENT '支付方式名称',
  `payMethodId` int(11) DEFAULT NULL COMMENT '支付通道ID',
  `payMethodName` varchar(255) DEFAULT NULL COMMENT '支付通道名称',
  `goodsAmount` decimal(10,2) DEFAULT '0.00' COMMENT '商品总价',
  `moneyPaid` decimal(10,2) DEFAULT NULL COMMENT '实际已支付金额',
  `service_fees` decimal(6,2) DEFAULT '0.00' COMMENT '订单服务费',
  `tea_fees` decimal(6,2) DEFAULT '0.00' COMMENT '订单茶位费',
  `foodsAmount` decimal(10,2) DEFAULT '0.00' COMMENT '菜品总价',
  `createTime` varchar(40) DEFAULT NULL COMMENT '创建日期时间',
  `payTime` varchar(40) DEFAULT NULL COMMENT '支付日期时间',
  `isDelete` tinyint(1) NOT NULL DEFAULT '0',
  `addStatus` int(1) DEFAULT '0' COMMENT '是不是用户加单：默认0不是，1是',
  `orderType` int(1) DEFAULT '1' COMMENT '订单类型：默认1堂食，2外带，3外卖',
  `wxpaystring` varchar(255) DEFAULT NULL COMMENT '微信支付',
  `paySign` varchar(255) DEFAULT NULL COMMENT '微信支付Sign',
  `contactNumber` varchar(50) DEFAULT '' COMMENT '餐馆编号',
  `contactName` varchar(100) DEFAULT NULL COMMENT '餐馆名称',
  `contactLogoUrl` varchar(255) DEFAULT NULL COMMENT '餐馆logourl',
  `contactMemberNumber` varchar(50) DEFAULT '' COMMENT '餐馆的餐桌编号',
  `contactMemberName` varchar(100) DEFAULT NULL COMMENT '餐桌名称',
  `orderLongitude` varchar(64) DEFAULT NULL COMMENT '下单用户经度',
  `orderLatitude` varchar(64) DEFAULT NULL COMMENT '下单用户纬度',
  `orderInArea` tinyint(4) DEFAULT NULL COMMENT '下单是否在服务范围',
  `methodPayStatus` tinyint(4) NOT NULL DEFAULT '0' COMMENT '通道支付状态 0未提交 1已提交 2回调已返回 3完成',
  `methodNotifyStatus` tinyint(4) NOT NULL DEFAULT '0' COMMENT '支付通道查询状态 0未查询 1已查询 2已返回 3完成',
  `orderAssignedNumber` varchar(5) DEFAULT NULL COMMENT '商家订单排号字段 4位 0填充',
  `payTransaction` varchar(255) DEFAULT NULL COMMENT '支付通道流水号',
  `printerId` int(11) DEFAULT NULL COMMENT '下单时主订单对应的打印机编号',
  `printerStatus` tinyint(2) DEFAULT '0' COMMENT '打印状态 0未打印 1:成功 2失败',
  `printerDescribe` varchar(255) DEFAULT NULL COMMENT '打印错误时错误描述',
  `courtId` int(11) DEFAULT '0' COMMENT '美食广场Id 非美食广场餐厅默认为0',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=1736 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of mos_wx_order
-- ----------------------------

-- ----------------------------
-- Table structure for mos_wx_order_goods
-- ----------------------------
DROP TABLE IF EXISTS `mos_wx_order_goods`;
CREATE TABLE `mos_wx_order_goods` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `orderSN` varchar(50) NOT NULL COMMENT '订单编号',
  `contactNumber` varchar(50) NOT NULL COMMENT '网点编号(餐馆编号)',
  `contactMemberNumber` varchar(50) NOT NULL COMMENT '餐馆的餐桌编号',
  `goodsId` int(11) DEFAULT NULL COMMENT '菜品id',
  `goodsThumbnailUrl` varchar(255) DEFAULT NULL COMMENT '商品的缩略图',
  `goodsNumber` varchar(50) CHARACTER SET utf8 COLLATE utf8_unicode_ci NOT NULL COMMENT '商品编号',
  `goodsName` varchar(100) NOT NULL COMMENT '商品名称',
  `num` int(11) NOT NULL DEFAULT '0' COMMENT '商品数量',
  `goodsPrice` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '商品单价',
  `goodsType` tinyint(2) NOT NULL DEFAULT '1' COMMENT '计价方式 1:按份计价 2:单位重量收费 3:套餐主记录 4:套餐非称重菜品 5:套餐称重菜品',
  `addStatus` int(1) DEFAULT '0' COMMENT '是不是用户加单菜品：默认0不是，1是',
  `unitName` varchar(5) DEFAULT NULL COMMENT '单位名称(斤,两,条)等',
  `goodsWeight` decimal(11,2) DEFAULT NULL,
  `groupNumber` smallint(6) DEFAULT NULL COMMENT '套餐编号 同一订单下同一编号的为同一套餐',
  `printerId` int(11) DEFAULT NULL COMMENT '下单时订单菜品对应的打印机编号',
  `printerStatus` tinyint(2) DEFAULT '0' COMMENT '打印状态 0未打印 1:成功 2失败',
  `printerDescribe` varchar(255) DEFAULT NULL COMMENT '打印错误时错误描述',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3957 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of mos_wx_order_goods
-- ----------------------------

-- ----------------------------
-- Table structure for mos_wx_value
-- ----------------------------
DROP TABLE IF EXISTS `mos_wx_value`;
CREATE TABLE `mos_wx_value` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '有效期',
  `key` varchar(64) DEFAULT NULL COMMENT '名称',
  `value` varchar(255) DEFAULT NULL COMMENT '值',
  `token_time` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

